This sample shows how to call GetZoneAsync with required parameters and parse the result.

var credential = new DefaultAzureCredential();
var client = new FarmBeatsClient(credential).GetZonesClient("2022-11-01-preview");

Response response = await client.GetZoneAsync("<partyId>", "<zoneId>");

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("partyId").ToString());
Console.WriteLine(result.GetProperty("type").ToString());
